import React from 'react';

const RoomList = ({ rooms, joinRoom }) => {
  return (
    <div>
      <h2>Available Rooms</h2>
      <ul>
        {rooms.map(room => (
          <li key={room.id}>
            {room.name}
            <button onClick={() => joinRoom(room.id)}>Join</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default RoomList;
